import React, { useEffect, useState } from 'react'
import DataTable from './DataTable';

const columns = [
    { field: 'knowledge_id', headerName: 'Knowledge Id', width: 150 },
    { field: 'product_version_id', headerName: 'Product Version Id', width: 150 },
    { field: 'knowledge_number', headerName: 'Knowledge Number', width: 150 },
    { field: 'build_number', headerName: 'Build Number', width: 150 },
    { field: 'file_version', headerName: 'File Version', width: 150 },
    { field: 'release_date', headerName: 'Release Date', width: 150 },
    { field: 'kb_url', headerName: 'Kb Url', width: 200 },
    { field: 'kb_detail', headerName: 'Kb Detail', width: 150 },
];

const userTableStyles = {
    height: '800px',
};

const Release2022 = ({ onError }) => {
    const [user, setUser] = useState([]);

    useEffect(() => {
        fetch('https://localhost:8082/release2022')
            .then((response) => response.json())
            .then((json) => setUser(json))
            .catch(() => onError())
    }, []);

    return (
        <DataTable
            rows={user}
            columns={columns}
            loading={!user.length}
            sx={userTableStyles}
        />
    );
};

export default Release2022;
